import { GET_USERS} from "./action-types"


const initialState = {
    users : [],
    searched:''
}


const reducer = (state = initialState, action) =>{
    switch(action.type){
        case GET_USERS:
            return {
                ...state,
                users: action.payload
            }

        default:
            return {...state}
    
        }
}

export default reducer;
